import { useState, useEffect } from "react";
import api from "../api";

const SubsComponent = () => {
    const [subData, setSubData] = useState({}); // Изменено на объект

    useEffect(() => {
        const fetchData = async () => {
            try {
                const response = await api.get('/user/active-subs');
                // Проверка, что response.data является объектом
                if (typeof response.data === 'object' && response.data !== null) {
                    setSubData(response.data);
                    console.log(response.data);
                } else {
                    console.error('Invalid data format:', response.data);
                }
            } catch (error) {
                console.error('Error fetching active subscriptions:', error);
            }
        };

        fetchData();
    }, []);

    return (
        <div>
            <p>Active subs</p>
            {Object.keys(subData).map(key => (
                <div key={key}>
                    <strong>{key}:</strong> {subData[key]}
                </div>
            ))}
        </div>
    );
};

export default SubsComponent;
